INSERT INTO `berita` (`id_berita`, `id_user`, `id_kategori`, `updater`, `slug_berita`, `judul_berita`, `isi`, `status_berita`, `jenis_berita`, `keywords`, `gambar`, `icon`, `hits`, `urutan`, `tanggal_mulai`, `tanggal_selesai`, `tanggal_post`, `tanggal_publish`, `tanggal`) VALUES
(6, 4, 5, '', 'java-web-media-pindah-rumah', 'Java Web Media Pindah Rumah', '<p>Assalamualaikum wr wb.<br />Teman-teman siswa, tutor Dan rekan-rekan lainnya.</p>\r\n<p>Bersama ini, kami Java Web Media terhitung tanggal 26 Januari 2020 resmi pindah tempat kursus yang semula Di Gang Senggol Pondok Cina, sekarang pindah ke rumah Baru.</p>\r\n<p>Alamat barunya adalah:<br />Java Web Media<br />Mall Depok Town Square (DETOS)<br />Lantai 2 Unit SS 5-7 (Samping Gerai Service Center Samsung)<br />Jl. Margonda Raya No. 1 Kota Depok.</p>\r\n<p>Mohon doanya semoga menjadi tempat kursus yang memberi manfaat penyebaran ilmu Dan kebaikan.</p>\r\n<p>Waalaikumsalam wr wb<br />#kursusdesaingrafis #kursus #kursusstatistik #kursusweb #kursusandroid #statistics #spss #stata #wordress #laravel #codeigniter #javawebmedia</p>', 'Publish', 'Berita', 'Bersama ini, kami Java Web Media terhitung tanggal 26 Januari 2020 resmi pindah tempat kursus yang semula Di Gang Senggol Pondok Cina, sekarang pindah ke rumah Baru.', 'photo_2020-01-22_12-29-13.jpg', 'adad', 48, 0, NULL, NULL, '2019-10-07 12:27:46', '2019-10-07 12:27:30', '2020-02-18 03:26:32'),
(7, 4, 5, '', 'pengajar-praktisi-dosen', 'Pengajar Praktisi & Dosen', '<p>Para pengajar adalah praktisi dan dosen yang berpengalaman di bidangnya. Mereka rata-rata telah berpengalaman di bidangnya mulai dari 2-10 tahun.</p>\r\n<p>Anda akan belajar secara langsung dari praktisi yang sudah berpengalaman. Mudah dipahami, terstruktur dan bisa konsultasi kapan pun Anda mau.</p>', 'Publish', 'Keunggulan', 'Para pengajar adalah praktisi  dan dosen yang berpengalaman di bidangnya.', 'Kursus_Banner-011.jpg', 'fa fa-graduation-cap', 26, 2, NULL, NULL, '2019-11-05 05:31:59', '2019-11-05 05:30:24', '2020-02-18 07:09:56'),
(8, 4, 5, '', 'pembuatan-website-profil', 'Pembuatan Website Profil', '<p>Pastikan perusahaan Anda bisa diakses secara online sehingga meningkatkan brand image perusahaan yang akhirnya meningkatkan omset usaha.</p>\r\n<h3><strong>Tujuan</strong></h3>\r\n<p>Website perusahaan dibangun sebagai:</p>\r\n<ul>\r\n<li>Sarana komunikasi resmi perusahaan dengan pelanggan</li>\r\n<li>Menyediakan informasi resmi perusahaan</li>\r\n<li>Menyajikan informasi produk dan layanan yang dimiliki</li>\r\n<li>Sebagai media pemasaran bagi perusahaan</li>\r\n</ul>\r\n<h3><strong>Fitur-fitur utama</strong></h3>\r\n<p>Website perusahaan ini menyediakan fitur-fitur sebagai berikut (disesuaikan dengan paket yang dipilih):</p>\r\n<ol>\r\n<li>Modul Berita untuk mengelola dan menampilkan berita</li>\r\n<li>Modul Profil untuk mengelola dan menampilkan profil perusahaan</li>\r\n<li>Modul Staff untuk mengelola dan menampilkan data staff/personil perusahaan</li>\r\n<li>Modul Galeri untuk mengelola galeri foto dan menampilkannya</li>\r\n<li>Modul Video berfungsi untuk mempublikasikan video sebagai sarana komunikasi</li>\r\n<li>Modul Agenda/Event untuk menampilkan event-event atau agenda yang ada di perusahaan</li>\r\n<li>Modul Produk dan layanan untuk mengelola dan menampilkan produk/layanan yang dipasarkan</li>\r\n<li>Modul Kontak untuk mengelola komunikasi pelanggan/customer dengan perusahaan</li>\r\n<li>Modul SEO untuk membantu hasil pencarian di Google</li>\r\n<li>Integrasi dengan jejaring sosial yang dimiliki</li>\r\n<li>Dan fitur-fitur lainnya</li>\r\n</ol>\r\n<h3>&nbsp;</h3>', 'Publish', 'Layanan', 'Pastikan perusahaan Anda bisa diakses secara online sehingga meningkatkan brand image perusahaan yang akhirnya meningkatkan omset usaha.', 'website-perusahaan-company-profile-web-javawebmedia1.jpg', 'fa fa-globe', 82, 0, NULL, NULL, '2020-01-16 08:04:58', '2020-01-16 08:01:54', '2020-02-18 08:24:56'),
(9, 4, 5, '', 'web-based-application', 'Web Based Application', '<p>Aplikasi bisnis berbasis web? Situs pendaftaran online untuk menunjang bisnis Anda? Kami berpengalaman dalam merencanakan &amp; mengembangkan aplikasi tersebut.</p>\r\n<h3><strong>Tujuan</strong></h3>\r\n<p>Website perusahaan dibangun sebagai:</p>\r\n<ul>\r\n<li>Otomasi proses bisnis yang bisa diakses 24 jam dengan internet</li>\r\n<li>Menyederhanakan proses pengumpulan data konsumen/customer/siswa dsb</li>\r\n<li>Sarana pengelolaan proses bisnis/usaha yang mudah dan praktis</li>\r\n</ul>\r\n<h3><strong>Fitur-fitur utama</strong></h3>\r\n<p>Website perusahaan ini menyediakan fitur-fitur sebagai berikut (disesuaikan dengan paket yang dipilih):</p>\r\n<ol>\r\n<li><strong>Fitur pendaftaran online</strong></li>\r\n<li><strong>Fitur login, logout, update profile dan transaksi bagi konsumen/customer</strong></li>\r\n<li><strong>Fitur-fitur lain yang disesuaikan dengan kebutuhan perusahaan</strong></li>\r\n<li>Modul Berita untuk mengelola dan menampilkan berita</li>\r\n<li>Modul Profil untuk mengelola dan menampilkan profil perusahaan</li>\r\n<li>Modul Staff untuk mengelola dan menampilkan data staff/personil perusahaan</li>\r\n<li>Modul Galeri untuk mengelola galeri foto dan menampilkannya</li>\r\n<li>Modul Video berfungsi untuk mempublikasikan video sebagai sarana komunikasi</li>\r\n<li>Modul Agenda/Event untuk menampilkan event-event atau agenda yang ada di perusahaan</li>\r\n<li>Modul Produk dan layanan untuk mengelola dan menampilkan produk/layanan yang dipasarkan</li>\r\n<li>Modul Kontak untuk mengelola komunikasi pelanggan/customer dengan perusahaan</li>\r\n<li>Modul SEO untuk membantu hasil pencarian di Google</li>\r\n<li>Integrasi dengan jejaring sosial yang dimiliki</li>\r\n<li>Dan fitur-fitur lainnya</li>\r\n</ol>', 'Publish', 'Layanan', 'Aplikasi bisnis berbasis web? Situs pendaftaran online untuk menunjang bisnis Anda? Kami berpengalaman dalam merencanakan & mengembangkan aplikasi tersebut.', 'web-application-pendaftaran-online-javawebmedia.jpg', 'fa fa-laptop', 69, 2, NULL, NULL, '2020-01-16 08:08:16', '2020-01-16 08:07:46', '2020-02-16 15:18:27'),
(10, 4, 5, '', 'profil-java-web-media', 'Profil Java Web Media', '<h2>Java Web Media</h2>\r\n<p>Java Web Media didirikan oleh Andoyo dan online pada tanggal 26 April 2010. Java Web Media awalnya hanya bergerak di bidang pembuatan dan pengembangan website serta agensi desain grafis. Awal tahun 2011, perusahaan ini kemudian mulai bergera di bidang pengembangan sumber daya manusia, khususnya di bidang keahlian computer Graphic Design, Web Design dan Web Development.</p>\r\n<h2>Tentang Andoyo</h2>\r\n<p><strong>Andoyo&nbsp;</strong>adalah pendiri Java Web Media. Aktif mengajar Graphic Design, Web Design dan Web Programming. Lahir di Blora, 22 Februari 1983.</p>\r\n<p>Lulus dengan predikat Wisudawan Terbaik dari Teknik Sipil&nbsp; Universitas Negeri Semarang pada tahun 2006. Pernah bekerja sebagai Site Engineer di sebuah perusahaan kontraktor. Mulai blogging sejak masih bekerja sebagai kontraktor di tahun 2008.</p>\r\n<p>Kecintaanya pada teknologi web akhirnya mengarahkannya untuk mempelajari Graphic Design dan Web Design di Natcoll Design Technology, Wellington New Zealand di tahun 2009. Semenjak itu, Graphic Design dan Web Design menjadi salah satu&nbsp;<em>passion&nbsp;</em>di dalam hidupnya.</p>\r\n<p>Saat ini aktivitas selain mengajar adalah mengelola usahanya yang bergerak di bidang graphic design, web design, web development dan web education. Anda dapat mengunjungi situs resminya di&nbsp;<a href=\"http://www.javawebmedia.com/\">www.javawebmedia.com</a>.</p>\r\n<p>Aktivitas berikutnya adalah sebagai mahasiswa Magister Teknologi Informasi di Universitas Indonesia. Setelah pulang bekerja kemudian berangkat kuliah di Kampus Salemba, Fakultas Ilmu Komputer Universitas Indonesia.</p>', 'Publish', 'Profil', 'ProfilJava Web Media', 'BANNER_INTERNAL_ASLI-01.jpg', '', 71, 0, NULL, NULL, '2020-01-20 13:26:31', '2020-01-20 13:24:38', '2020-02-18 22:04:31'),
(11, 4, 5, '', 'tersedia-kursus-private', 'Tersedia Kursus Private', '<p>Anda ingin kursus sekaligus menyelesaikan permasalahan yang Anda hadapi (<em>real project</em>)?&nbsp;</p>\r\n<p>Maka sebaiknya ambil paket kursus private yang kami sediakan. Materi kursus akan disesuaikan dengan kasus nyata di lapangan yang sedang Anda hadapi.</p>', 'Publish', 'Keunggulan', 'Anda bisa kursus sekaligus menyelesaikan permasalahan yang Anda hadapi (real project)', 'Kursus_Banner-04.jpg', 'fa fa-user', 28, 1, NULL, NULL, '2020-01-21 07:09:08', '2020-01-21 07:08:21', '2020-02-18 07:09:49'),
(12, 4, 5, '', 'jadwal-flexible', 'Jadwal Flexible', '<p>Bagi Anda yang ingin belajar, kami menerapkan jadwal flexible. Jadwal bisa didiskusikan bersama dengan tutor secara langsung.</p>\r\n<p>Kami juga menyediakan kursus kelas weekday, weekend dan kelas malam. Karyawan bisa mengambil kelas malam atau weekend (sabtu dan minggu). Bagi Anda yang memiliki waktu luang, Anda dapat mengambil kelas weekday.</p>', 'Publish', 'Keunggulan', 'Bagi Anda yang ingin belajar, kami menerapkan jadwal flexible. Jadwal bisa didiskusikan bersama dengan pengajar', 'Kursus_Banner-031.jpg', 'fa fa-clock', 28, 6, NULL, NULL, '2020-01-21 07:12:14', '2020-01-21 07:09:39', '2020-02-18 07:10:22'),
(13, 4, 5, '', 'semi-private', 'Semi Private', '<p>Untuk paket kelas adalah 2-5 siswa perkelas. Jika dalam 2 minggu kelas tidak terpenuhi, maka 1 orang tetap jalan.</p>\r\n<p>Java Web Media menetapkan&nbsp;<em>deadline</em> maksimal 2 minggu jika kelas tidak memenuhi kuota minimal. Misalnya kursus seharusnya minimal 2 siswa, tapi jika dalam jangka waktu dua minggu kuota belum terpenuhi, maka kelas akan tetap dilaksanakan meskipun hanya dengan 1 siswa.</p>', 'Publish', 'Keunggulan', 'Untuk paket kelas adalah 2-5 siswa perkelas. Jika dalam 2 minggu kelas tidak terpenuhi, maka 1 orang tetap jalan.', 'Kursus_Banner-05.jpg', 'fa fa-users', 0, 5, NULL, NULL, '2020-02-18 14:00:35', '2020-02-18 13:58:00', '2020-02-18 07:10:16'),
(14, 4, 5, '', 'course-with-your-own-project', 'Course with your own project', '<p>Kursus dengan materi sesuai proyek Anda sendiri. Materi Anda yang tentukan.</p>\r\n<p>Anda bisa kursus dengan materi sesuai kebutuhan pekerjaan Anda. Banyak siswa di Java Web Media memilih kelas ini karena mereka bisa fokus kursus pada pekerjaan yang sedang mereka hadapi.</p>', 'Publish', 'Keunggulan', 'Kursus dengan materi sesuai proyek Anda sendiri. Materi Anda yang tentukan.', 'NITRICO_Product_Knowledge_03_OK_(1)_Page_13.jpg', 'fa fa-home', 0, 4, NULL, NULL, '2020-02-18 14:06:26', '2020-02-18 14:04:18', '2020-05-20 02:31:25'),
(15, 4, 5, '', 'gratis-konsultasi', 'Gratis Konsultasi', '<p>Setelah selesai kursus akan disupport seumur hidup. Anda bisa konsultasi kapan saja.</p>\r\n<p>&nbsp;</p>', 'Draft', 'Keunggulan', 'Setelah selesai kursus akan disupport seumur hidup. Anda bisa konsultasi kapan saja.', 'login1.jpg', 'fab fa-whatsapp', 0, 3, NULL, NULL, '2020-02-18 14:09:08', '2020-02-18 14:07:31', '2020-05-20 02:30:47');
