INSERT INTO `funnel` (`id_funnel`, `id_kategori_funnel`, `id_user`, `slug_funnel`, `judul_funnel`, `isi`, `gambar`, `website`, `hits`, `status_funnel`, `urutan`, `tanggal_post`, `tanggal`) VALUES
(1, 1, 4, 'apa-itu-nitrico', 'Apa itu Nitrico?', '<p>NITRICO merupakan minuman kesehatan berbentuk serbuk, yang diracik secara khusus mengandung berbagai ekstrak dan senyawa penting (33 senyawa) yang mengandung Nitric Oxide (NO) bersumber dari makanan yang ada di negeri Indonesia tercinta, sehingga mampu untuk melawan berbagai jenis parasit dan virus yang menyebabkan beberapa penyakit degeneratif termasuk Covid-19 yang ganas dengan cara enak dan segar.</p>\r\n<p>NITRICO SABEDIM yang banyak mengandung buah delima kaya akan enzim metalotionein yang memiliki gugus sul hidril (-HS) dan atom-atom berelektro negatif tinggi eperti S dan O yang berfungsi sebagai chelating agen (pengikatlogamberat) yang dapat mengikat logam-logam berat tersebut dan diekskresikan lewat urin sehingga mencegah terjadinya stunting, autis dan penurunan IQ pada anak.</p>\r\n<p>Mencegah preklampsia, diabetes, hipertensi dan stress Preklmpsia terjadi karena penyumbatan pada pembuluh darah akibat diabetes, hipertensi. NITRICO COKLAT mengandung gas NO (Nitrit Oksida) sebagai vasodilator yang dapat memperlebar pembuluh darah danmemecah kolesterol dan gula darah dalam tubuh se hingga mencegah terjadinya hipertensi, kolesterol dan preklampsia serta stress.</p>', 'NITRICO_Distributor_Ad_01_a.jpg', '', NULL, 'Publish', NULL, '2020-05-29 09:04:01', '2020-05-29 03:45:28'),
(2, 4, 4, 'aturan-konsumsi-nitrico-untuk-pencegahan-dan-therapy-covid-19', 'Aturan Konsumsi NITRICO untuk Pencegahan dan Therapy COVID-19', '<h4><strong>Pencegahan COVID-19</strong></h4>\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>Minimal 1 sachet setiap pagi, Siang dan malam (3 sachet/hari)</li>\r\n<li>Bagi mereka yang sehat dan harus berada di lingkungan beresiko seperti dokter, perawat, atau pekerja diluar rumah, Minimal 2 sachet sekali minum setiap pagi, siang, dan malam (6 sachet/hari)</li>\r\n</ol>\r\n<h4><strong>Pengobatan</strong></h4>\r\n<p>Minimal 3 sachet setiap pagi, siang, dan malam (9 sachet/hari)</p>', 'Posting_IG_NITRICO_April_2020_01_COKLAT.jpg', '', NULL, 'Publish', NULL, '2020-05-29 09:24:43', '2020-05-29 03:32:03'),
(3, 3, 4, 'mencegah-preklampsia-autis-stunting-diabetes-hipertensi-stress-keguguranpenurunan-iq-pada-anak-dan-kanker', 'Mencegah preklampsia, autis, stunting, diabetes, hipertensi, stress, keguguran,penurunan IQ pada anak dan kanker', '<h4><strong>Autis, stunting, hiperaktif dan penurunan IQ karena logam berat </strong></h4>\r\n<p>Penyebab autis, stunting dan penurunan IQ anak adalah adanya kontaminasi logam berat organic seperti uap (C<sub>2</sub>H<sub>5</sub>)<sub>4</sub>Pb atau tetra etil lead dari bensin, gigi palsu mengandung logam berat, behel gigi mengandung logam berat maupun dari sumber sumber kontaminasi logam berat lainnya yang masuk ke dalam tubuh ibu hamil dan menembus plasenta:</p>\r\n<ol>\r\n<li>Saat logam berat mengikat Zn sebagai kofaktor hormon pertumbuhan saat ibu hamil maka menyebabkan terjadinya stunting ketika anak lahir</li>\r\n<li>Saat logam berat merusak saraf otak embrio saat ibu hamil maka terjadi abnormalitas pada otak menyebabkan autis, hipraktif dan penurunan IQ pada anak</li>\r\n</ol>\r\n<p>Nitrico merah yang banyak mengandung buah delima kaya akan enzim metalotionein yang memiliki gugus sulfihidril (-HS) dan atom-atom berelektronegatif tinggi seperti S dan O yang berfungsi sebagai chelating agen (pengikat logam berat) ang dapat mengikat logam logam berat tersebut dan diekskresikan lewat urin sehingga mencegah terjadinya stunting, autis dan penurunan IQ pada anak.</p>\r\n<h4><strong>Mencegah preklampsia, diabetes, hipertensi, stress</strong></h4>\r\n<p>Preklmpsia terjadi karena penyumbatan pada pembuluh darah akibat diabetes, hipertensi. Nitrico coklat mengandung gas NO sebagai vasodilator dapat memperlebar pembuluh darah dan memecah kolesterol dan gula darah dalam dalam tubuh sehingga mencegah terjadinya hipertensi, kolesterol dan preklmpsia dan stress.</p>\r\n<h4><strong>Mencegah keguguran saat hamil</strong></h4>\r\n<p>Perpaduan paparan logam berat organik dan stress pada ibu hamil menyebabkan kandungan lemah dan risiko keguguran. Perpaduan NO pada Nitrico merah untuk mengikat logam berat dan NO pada nitrico coklat untuk menurunkan stress dan mencegah risiko keguguran pada ibu hamil.</p>\r\n<h4><strong>Mencegah kanker</strong></h4>\r\n<p>Penyakit kanker terjadi karena ikatan radikal bebas dengan DNA. Radikal bebas antara lain dari paparan benzena, toluena dari bahan bakar bensin, naftalena dalam kapur barus menyebaban leukemia, dan radikal-radikal bebas lain yang masuk dalam tubuh lewat makanan seperti kacang-kacangan mengandung aflatoksin dan nitrosamine dari daging panggang, akrilamid dari nasi kopi dan polutan udara. Untuk mencegah efek radikal bebas penyebab kanker harus konsumsi nitrico kaya glutation. Glutation yang ada dalam tubuh manusia, sudah dimiliki manusia juga dapat berkurang karena paparan logam berat dapat menyebabkan kanker secara tidak langsung. Sehingga, untuk mencegah kanker karena logam berat harus mengkonsumsi nitrico merah.</p>', 'NITRICO_Distributor_Ad_01_e.jpg', '', NULL, 'Publish', NULL, '2020-05-29 09:30:51', '2020-05-29 03:33:46'),
(4, 3, 4, 'bagaimana-nitrico-bekerja-melawan-berbagai-jenis-parasit-dan-virus', 'Bagaimana Nitrico Bekerja Melawan Berbagai Jenis Parasit Dan Virus?', '<p>Nitric Oxide (NO) yang terkandung didalam Formula NITRICO merupakan sebuah zat yang sebenarnya secara alami bisa dihasilkan oleh tubuh untuk membunuh virus maupun parasit yang masuk kedalam tubuh. namun untuk melawan Covid-19, dibutuhkan kadar NO (Nitric Oxide) lebih banyak. Dengan mengkonsumsi NITRICO akan sangat mampu meningkatkan kadar NO tubuh, meningkatkan daya tahan tubuh, serta meningkatkan kesehatan tubuh secara umum karena Formula NITRICO mengandung sekitar 33 senyawa penting yang dibutuhkan tubuh manusia. Temuan bahan aktif.</p>\r\n<p>NO (Nitric Oxide) dari makanan ini lebih maju dibandingkan dengan temuan dari lembaga riset Bellerophon dari USA yang merilis temuannya tanggal 20 Maret 2020 saat konferensi pers bersama Presiden USA Donald Trump dan kepala FDA Amerika, dimana NO (Nitric Oxide) diambil dari udara sebagai obat dan dimasukkan kepernapasan lewat ventilator.</p>\r\n<p style=\"text-align: center;\"><strong>&ldquo;NITRICO mengandung Kadar NO(Nitric Oxide)Tinggi&rdquo;</strong></p>', 'NITRICO_Distributor_Ad_01_b.jpg', '', NULL, 'Publish', NULL, '2020-05-29 10:39:42', '2020-05-29 03:41:36'),
(5, 3, 4, 'keunggulan-nitrico', 'Keunggulan Nitrico', '<ol>\r\n<li>Mengandung 33 Senyawa Penting untuk meningkatkan imun tubuh</li>\r\n<li>Mengandung Nitric Oxide yang sangat dibutuhkan tubuh dalam melawan virus</li>\r\n<li>Mampu meningkatkan kadar Endorphin tubuh</li>\r\n<li>Bahan baku berkualitas</li>\r\n<li>Berserti kat BPOM</li>\r\n<li>Produk Indonesia 100%&nbsp;</li>\r\n</ol>', 'NITRICO_Distributor_Ad_01_b1.jpg', '', NULL, 'Publish', NULL, '2020-05-29 10:44:32', '2020-05-29 03:44:32'),
(6, 4, 4, 'varian-produk-nitrico', 'Varian Produk Nitrico', '<p><strong>NITRICO COKLAT</strong></p>\r\n<ul>\r\n<li>BPOM RI MD 867013167071</li>\r\n<li>Kemasan 150g /10 Sachet @15g</li>\r\n</ul>\r\n<p><strong>NITRICO SABEDIM&nbsp;</strong></p>\r\n<ul>\r\n<li>BPOM RI MD 867013219071</li>\r\n<li>Kemasan 150g /10 Sachet @15g</li>\r\n</ul>', 'NITRICO_Distributor_Ad_01_c.jpg', '', NULL, 'Publish', NULL, '2020-05-29 10:47:26', '2020-05-29 03:47:26');
