(1, 4, NULL, 1, 'nitrico-chocolate-1', 'NIT203', 'Nitrico Chocolate', 'Publish', 'Pcs', 1, 'Nitrico Chocolate', '<p>NITRICO adalah makanan fungsional baru&nbsp;yang diformulasi dengan kandungan senyawa&nbsp;aktif NO (Nitric Oxide) supertinggi.</p>\r\n<p>Nitric Oxide di dalam NITRICO&nbsp; adalah radikal bebas yang&nbsp;berfungsi sebagai racun&nbsp;yang digunakan tubuh untuk melawan virus. formula Nitric Oxide diseimbangkan sehingga sifat radikal bebas-nya dapat digunakan tubuh untuk melawan virus tanpa merusak tubuh.</p>\r\n<p>Kebanyakan jenis virus bekerja saat sistem kekebalan tubuh manusia melemah. NITRICO membantu modulasi sistem kekebalan manusia yang disebut makrofag. Makrofag menggunakan NO sebagai \"amunisi\" saat menghadapi invasi mikroba, parasit,&nbsp;maupun virus, termasuk virus sars-cov-2 atau penyebab COVID-19. Tubuh secara alamiah menghasilkan Nitrogen Oksida (NO), namun&nbsp;NO yang dihasilkan karena faktor penuaan daya produksinya semakin kurang untuk melawan gangguan tersebut. NITRICO dengan formula Nitric Oxide-nya membantu ketersediaan NO dalam tubuh untuk melawan penyakit.<br />.<br /><br />Varian NITRICO<br /><br />1 .&nbsp;NITRICO SABEDIM<br /><br />Kemasan : 150g / 10 Sachet @15g<br /><br />Terdiri dari 17 senyawa aktif NO (Nitric Oxide) supertinggi, terkandung dalam:<br /><br />Ekstrak delima Merah, Psyllium husk, (Serat gandum), Ekstrak Stroberi, Ekstrak Apel, Ekstrak Manggis, antioksidan asam askorbat, Ekstrak Bit Merah, Ekstrak Tebu, L-Glutation, Ekstrak buah dan sayur, kalsium dari Ekstrak Ganggang laut, pengatur keasaman asam malat, Ekstrak Anggur, Ekstrak Lemon, Ekstrak Jeruk, Premiks Vitamin dan Mineral, L-Arginin, Ekstrak Kopi Hijau (mengandung Laktosa)<br /><br />!!! --- mengandung alergen, perhatikan daftar bahan di dalam kurung ---!!!<br /><br />2 .&nbsp;NITRICO COKELAT<br /><br />Kemasan : 150g / 10 Sachet @15g<br /><br />Terdiri dari 17 senyawa aktif NO (Nitric Oxide) supertinggi.<br />Ekstrak kakao, Krimer nabati, Serat jagung, (Ekstrak malt), Ekstrak semangka, (Kolagen ikan), Ekstrak Tebu, Lactobasillus bulgaricus, L-Glutation, kalsium dari Ekstrak Ganggang laut, Ekstrak Lemon, Ekstrak Jeruk sitrun, Premiks Vitamin dan Mineral, Perisa sintetik vanilla krim,asam jawa,Gula alami</p>', 200000, 1350000, 190000, 2500000, 'NITRICO_Distributor_Ad_01_a1.jpg', 'Nitrico Chocolate', '0000-00-00', '0000-00-00', 10, 'Persentase', 1, 100, 100, 100, '10 x 20 x 30 cm', 85, '2020-05-21 10:24:55', '2020-06-07 23:36:04'),
(2, 4, NULL, 2, 'nitrico-delima-merah-2', 'K100', 'Nitrico Delima Merah', 'Publish', 'Pcs', 1, 'Nitrico Kemasan 100 Gram', '<p>NITRICO adalah makanan fungsional baru&nbsp;yang diformulasi dengan kandungan senyawa&nbsp;aktif NO (Nitric Oxide) supertinggi.</p>\r\n<p>Nitric Oxide di dalam NITRICO&nbsp; adalah radikal bebas yang&nbsp;berfungsi sebagai racun&nbsp;yang digunakan tubuh untuk melawan virus. formula Nitric Oxide diseimbangkan sehingga sifat radikal bebas-nya dapat digunakan tubuh untuk melawan virus tanpa merusak tubuh.</p>\r\n<p>Kebanyakan jenis virus bekerja saat sistem kekebalan tubuh manusia melemah. NITRICO membantu modulasi sistem kekebalan manusia yang disebut makrofag. Makrofag menggunakan NO sebagai \"amunisi\" saat menghadapi invasi mikroba, parasit,&nbsp;maupun virus, termasuk virus sars-cov-2 atau penyebab COVID-19. Tubuh secara alamiah menghasilkan Nitrogen Oksida (NO), namun&nbsp;NO yang dihasilkan karena faktor penuaan daya produksinya semakin kurang untuk melawan gangguan tersebut. NITRICO dengan formula Nitric Oxide-nya membantu ketersediaan NO dalam tubuh untuk melawan penyakit.<br />.<br /><br />Varian NITRICO<br /><br />1 .&nbsp;NITRICO SABEDIM<br /><br />Kemasan : 150g / 10 Sachet @15g<br /><br />Terdiri dari 17 senyawa aktif NO (Nitric Oxide) supertinggi, terkandung dalam:<br /><br />Ekstrak delima Merah, Psyllium husk, (Serat gandum), Ekstrak Stroberi, Ekstrak Apel, Ekstrak Manggis, antioksidan asam askorbat, Ekstrak Bit Merah, Ekstrak Tebu, L-Glutation, Ekstrak buah dan sayur, kalsium dari Ekstrak Ganggang laut, pengatur keasaman asam malat, Ekstrak Anggur, Ekstrak Lemon, Ekstrak Jeruk, Premiks Vitamin dan Mineral, L-Arginin, Ekstrak Kopi Hijau (mengandung Laktosa)<br /><br />!!! --- mengandung alergen, perhatikan daftar bahan di dalam kurung ---!!!<br /><br />2 .&nbsp;NITRICO COKELAT<br /><br />Kemasan : 150g / 10 Sachet @15g<br /><br />Terdiri dari 17 senyawa aktif NO (Nitric Oxide) supertinggi.<br />Ekstrak kakao, Krimer nabati, Serat jagung, (Ekstrak malt), Ekstrak semangka, (Kolagen ikan), Ekstrak Tebu, Lactobasillus bulgaricus, L-Glutation, kalsium dari Ekstrak Ganggang laut, Ekstrak Lemon, Ekstrak Jeruk sitrun, Premiks Vitamin dan Mineral, Perisa sintetik vanilla krim,asam jawa,Gula alami</p>', 190000, 1500000, 190000, 2000000, 'NITRICO_Distributor_Ad_01_d.jpg', 'Nitrico Kemasan 100 Gram', '0000-00-00', '0000-00-00', 0, 'Potongan', 1, 10, 1000, 1200, '10 x 20 x 30 cm', 2, '2020-05-30 06:51:00', '2020-06-07 23:37:17');
